import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [file, setFile] = useState(null);
  const [jobs, setJobs] = useState([]);
  const [loading, setLoading] = useState(false);
  const [atsScore, setAtsScore] = useState(null);
  const [suggestions, setSuggestions] = useState(null);
  const [applications, setApplications] = useState({});

  const handleFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const handleUpload = async (event) => {
    event.preventDefault();
    if (!file) return;

    const formData = new FormData();
    formData.append('resume', file);
    formData.append('jobCategory', 'software');

    setLoading(true);
    try {
      const response = await axios.post('http://localhost:5000/upload-resume', formData);
      setJobs(response.data.jobs);
      setAtsScore(response.data.atsScore);
      setSuggestions(response.data.suggestions);
    } catch (error) {
      console.error('Upload failed:', error);
      alert('Upload failed: ' + error.message);
    }
    setLoading(false);
  };

  const handleApply = async (job) => {
    try {
      const response = await axios.post('http://localhost:5000/apply-job', {
        jobData: job
      });

      setApplications(prev => ({
        ...prev,
        [job.id]: {
          status: 'queued',
          jobId: response.data.jobId
        }
      }));

      // Start polling for status
      pollApplicationStatus(response.data.jobId, job.id);
    } catch (error) {
      console.error('Application failed:', error);
      alert('Application failed: ' + error.message);
    }
  };

  const pollApplicationStatus = async (applicationId, jobId) => {
    const interval = setInterval(async () => {
      try {
        const response = await axios.get(`http://localhost:5000/application-status/${applicationId}`);
        setApplications(prev => ({
          ...prev,
          [jobId]: {
            status: response.data.status,
            jobId: applicationId
          }
        }));

        if (['completed', 'failed'].includes(response.data.status)) {
          clearInterval(interval);
        }
      } catch (error) {
        console.error('Status check failed:', error);
        clearInterval(interval);
      }
    }, 5000);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Job Matchmaker</h1>
      </header>

      <main>
        <section className="upload-section">
          <form onSubmit={handleUpload}>
            <input type="file" onChange={handleFileChange} accept=".pdf" />
            <button type="submit" disabled={!file || loading}>
              {loading ? 'Uploading...' : 'Upload Resume'}
            </button>
          </form>
        </section>

        {atsScore && (
          <section className="ats-section">
            <h2>ATS Score: {atsScore}%</h2>
            <div className="suggestions">
              <h3>Suggestions for Improvement:</h3>
              <p>{suggestions}</p>
            </div>
          </section>
        )}

        <section className="jobs-section">
          {jobs.map(job => (
            <div key={job.id} className="job-card">
              <h3>{job.title}</h3>
              <p className="company">{job.company}</p>
              <p className="location">{job.location}</p>
              {job.salary_min && job.salary_max && (
                <p className="salary">
                  ${job.salary_min.toLocaleString()} - ${job.salary_max.toLocaleString()}
                </p>
              )}
              <button 
                onClick={() => handleApply(job)}
                disabled={applications[job.id]?.status === 'completed'}
              >
                {applications[job.id]?.status || 'Quick Apply'}
              </button>
            </div>
          ))}
        </section>
      </main>
    </div>
  );
}

export default App;
